(this["webpackJsonpresume-cv"]=this["webpackJsonpresume-cv"]||[]).push([[9],{175:function(e,n,a){"use strict";a.r(n);var t=a(0),o=a(59),i=(a(1),a(5)),r=a(94),s=a.n(r),c=a(21),l=function(e){var n=Object.assign({},e);return Object(t.jsx)(i.b,Object(o.a)({},n))};n.default=function(){return Object(t.jsx)(c.a,{title:"About",description:"Learn about Padmalochan",children:Object(t.jsxs)("article",{className:"post markdown",id:"about",children:[Object(t.jsx)("header",{children:Object(t.jsx)("div",{className:"title",children:Object(t.jsx)("h2",{"data-testid":"heading",children:Object(t.jsx)(i.b,{to:"/about",children:"About Me"})})})}),Object(t.jsx)(s.a,{source:"\n# Intro\n\nI am particularly interested in projects that touch health and safety, imaging, social impact, and aerospace. If you think I can be helpful to you or would like to meet me, please feel free to get in touch.\n\n# Currently\n\nI have been actively looking for work. I\u2019m looking for an opportunity to develop my skills in Application Development and Project Management further, like I was doing in my previous role. Learning New Technologies like [Android Native](https://developer.android.com/studio), [Node.js](https://nodejs.org/en/), [Internet Of Things](https://en.wikipedia.org/wiki/Internet_of_things), and newbie to [Machine Learning](https://en.wikipedia.org/wiki/Machine_learning).\n\n\n# I like\n\n- Running\n- Skiing\n- Sailing and the sea\n- Space\n- Summer\n- [Books](https://www.goodreads.com/mdangelo)\n- Colored pencils ([Faber-Castell Polychromos](https://www.faber-castell.com/products/art-and-graphic/polychromos))\n- Podcasts ([The Daily](https://www.nytimes.com/column/the-daily), [Planet Money](https://www.npr.org/sections/money/), [The Indicator](https://www.npr.org/podcasts/510325/the-indicator-from-planet-money), [This American Life](https://www.thisamericanlife.org/), [99% Invisible](https://99percentinvisible.org/episodes/), [The Economist](http://radio.economist.com/), [Radiolab](https://www.wnycstudios.org/shows/radiolab), [Hidden Brain](https://www.npr.org/series/423302056/hidden-brain), [Inquiring Minds](https://inquiring.show), and others)\n- [Good design](/)\n- [Photography](https://instagram.com/dangelosaurus)\n\n# Travel / Geography\n\n- I am from originally from Buffalo, New York. I have since lived in Palo Alto, Mountain View, San Francisco, Seattle, and New York.\n- I've been to ~ 50 countries, some of which I have forgotten, and many of which I would like to revisit.\n- In 2016, I visited: Canada, Ethiopia, Austria, Germany, Belgium, Ireland, Northern Ireland, Italy, Romania, Sweden, Norway, Svalbard, Panama, Costa Rica, Uganda, Japan, and the UAE, mostly in that order.\n- In 2017, I visited: Canada, Japan, Denmark, Germany, Sweden, Estonia, Russia, the Netherlands, Belgium, the U.K., Spain, Iceland, France, Switzerland, Ethiopia, and Luxembourg.\n- In 2018, I visited: Canada, France, Italy, Israel, and the U.K.\n- In 2019, I visited: Canada, England, France, and Switzerland.\n- In 2020, I barely traveled 20 blocks. I stayed in New York and remodeled an apartment.\n- In 2021, I hope to start traveling again.\n- I am an Oregon Trail II enthusiast.\n\n# Fun facts\n\n- I have a list of thousands of ideas, like creating matching bow ties for cats and humans.\n- I almost always have a sketchbook with me and a [01 Sakura Pigma Micron Pen](https://www.sakuraofamerica.com/product/pigma-micron/).\n- I can't locate every country on a map.\n- I operate a [small angel fund](http://skepticalinvestments.biz/) with terrible returns.\n- I break about 30 traffic laws on a [cruiser](https://landyachtz.com/boards/cruiser/), [onewheel](https://onewheel.com/products/xr), [bicycle](https://www.citibikenyc.com/), or [electric skateboard](https://boostedusa.com/collections/electric-skateboards/products/boosted-mini-x) every single day.\n- I added this page because so many people complained that my site was just my resume.\n\n# I dream of\n\n- always finding inspiration.\n- enabling a brighter future.\n- doing better.\n- you not checking the commit history for earlier drafts of this file.\n\n# Websites from people I admire\n\n- [Alex Peysakhovich](http://alexpeys.github.io/)\n- [Chris Lengerich](http://www.chrislengerich.com/)\n- [Chris Saad](https://www.chrissaad.com/)\n- [Duncan Tomlin](http://duncantomlin.com/)\n- [Hawley Moore](http://hawleymoore.com/)\n- [Holman Gao](https://golmansax.com/)\n- [Ian Webster](http://ianww.com/)\n- [Johanna Flato](https://www.johannaflato.com/)\n- [Judy Mou](http://www.judymou.com/)\n- [Kristina Monakhova](https://kristinamonakhova.com/)\n- [Noah Trueblood](http://notrueblood.com/)\n- [Ruoxi Wang](http://ruoxiw.com/)\n- [Tom Sachs](https://www.tomsachs.org/)\n\nIf we are friends and you feel like you belong on this list, you're probably right. I'm sorry I forgot about you. Pester me and I'll add you.\n",renderers:{Link:l},escapeHtml:!1})]})})}}}]);
